wasm-pack build 在远程部署时执行，零依赖，可以安装到全局，直接使用 rsw 命令。也可以和 vite-plugin-rsw 插件配合使用 # 全局安装，执行 `rsw -h` 可查看帮助
npm i -g rsw-node # --------------------------------- # 项目中安装 rsw
npm i -D rsw-node # 或者
yarn add -D rsw-node Step1. 需要在项目根路径下创建 .rswrc.json 文件，例如 { "root": ".", // 默认为项目根路径，支持自定义路径，但是不可以超出项目根路径 "crates": [ "@rsw/chasm", // npm org "@rsw/game-of-life", // npm org { "name": "rsw-hello", "outDir": "custom/path" } // npm package，自定义输出路径 ]
} Step2. 当配置好 .rswrc.json 后，就可以在项目根路径下执行 rsw 命令，或者和 vite-plugin-rsw 配合使用，在 package.json 中添加如下代码。 { "scripts": { "rsw:deploy": "rsw && npm run build" },
} 具体使用，可以查看 lencx/learn-wasm .rswrc.json package.json vite.config.ts .github/workflows/deploy.yml

