// init 是 wasm 实例的初始化方法
// 在调用其他方法之前，必须先调用一次 init 方法，否则会报错
// init 会请求 `.wasm` 文件并且返回一个 `Promise`
import init, { greet } from 'wasm-test'; // ----------------------------------------- // 调用init方法，有两种方式 // 1.
// 在 react，vue3 中可以将其抽离为 `hook` 组件,
// 在进入生命周期时调用
init(); // 在调用过 init 方法之后，可以单独调用 greet 方法
greet('wasm'); // 2.
// 在初始化之后直接调用方法
init() .then(wasm => wasm.greet('wasm'));
